import { Component, OnInit } from '@angular/core';
import { Router, ActivatedRoute } from '@angular/router';
import { FamilyMember } from '../models/FamilyMember.model';
import { Member } from '../models/Member.model';
import { FamilyMemberService } from 'src/app/services/familyMember.service';

@Component({
  selector: 'app-create-update-member',
  templateUrl: './create-update-member.component.html',
  styleUrls: ['./create-update-member.component.css']
})
export class CreateUpdateMemberComponent  implements OnInit{
  // firstName: '';
  // lastName: '';
  // fatherName: '';
  // memberType: '';
  // gender: '';
  // dateOfBirth: '';
   //maritalStatusChk: string | undefined;
  // bloodGroup: '';
  // education: '';
  // permanentAddress: '';
  // mobile: '';
  // email: '';
  // area: '';
  // checkedSameAddress: boolean = false;
  // currentAddress: '';
  // proffession: '';
  // proffessionAddress: '';
  // proffessionEmail: '';
  // proffessionNumber: '';
  // checkIAffirm: '';
  // aborigine: '';

  familyMember: Member = {
    familyHead: false,
    firstName: '',
    lastName:  '',
    fatherName: '',
    gender: '',
    dateOfBirth: '',
    maritalStatus: '',
    bloodGroup: '',
    education: '',
    permanentAddress: '',
    mobile: '',
    email: '',
    area: '',
    checkedSameAddress: false,
    currentAddress: '',
    proffession: '',
    proffessionAddress: '',
    proffessionEmail: '',
    proffessionNumber: '',
    checkIAffirm: false,
    aborigine: '',
    status: 'Pending'
  };

  submitted = false;
  familyId: any = 0;
  memeberId: any;
  pageMode: string = '';

  constructor(private router: Router,
    private activatedRoute: ActivatedRoute,
    private familyMemberService: FamilyMemberService
  ) {}

  ngOnInit(): void{
    this.memeberId = this.activatedRoute.snapshot.paramMap.get('id')!;
    this.pageMode = this.activatedRoute.snapshot.paramMap.get('pageMode')!;
    this.familyMemberService.getFamilyIdByMemberId(this.memeberId).subscribe({
      next: (data) => {
        this.familyId = data;
        console.log(data);
      },
      error: (e) => console.error(e)
    });
    if(this.pageMode === 'edit'){
      this.familyMemberService.getMemberById(this.memeberId).subscribe({
        next: (data) => {
          this.familyMember = data;
          console.log(data);
        },
        error: (e) => console.error(e)
      });
    }
  }

  onSave(): void {
    // const data = {
    //   title: this.familyMember.title,
    //   description: this.tutorial.description,
    //   officeAddress: this.tutorial.officeAddress
    // };

    this.familyMemberService.create(this.familyMember, this.familyId).subscribe({
      next: (res) => {
        console.log(res);
        this.submitted = true;
      },
      error: (e) => console.error(e)
    });
  }

  csvInputChange(fileInputEvent: any) {
    console.log(fileInputEvent.target.files[0]);
  }

  goBack(id: string): void {
    this.router.navigate(['/family', id]);
  }
}
